function ExpenseItem() {
  return (
    <div>
      <h2>Expense Tracker!</h2>
      <h3>Expense Items</h3>
      <ul>
        <li>Food Rs 10</li>
        <li>Petrol Rs 100</li>
        <li>Movies Rs 200</li>
      </ul>
    </div>
  );
}
export default ExpenseItem;
